import React, { useState, useEffect } from 'react';

const AdminHome = ()  => {

    useEffect(() => {
        // called once after intial render
        fetchStudents();
        }, [] )


        const fetchStudents = (studentId) => {

          const endpoint = `${SERVER_URL}/students?studentId=${studentId}`;

          fetch(endpoint)
              .then((response) => response.json())
              .then((data) => {
                  // Assuming you have a function to process and display students' data
                  displayStudents(data);
              })
              .catch((err) => {
                  console.log("exception fetchStudents " + err);
                  setMessage("Exception. " + err);
              });
      };


    return (
        <div> 
        <div margin="auto" >
          <h3>Student List</h3>
        </div>
      </div>
    )
}

export default AdminHome;
